We can write the following function in which we unpack the youngest and oldest age from a sorted list of ages: fn run4() { let sorted_ages: (u8, u8, u8) = (18, 41, 65); let (youngest, _, oldest) = sorted_ages; println!("Youngest age: {}, oldest age: {}", youngest, oldest); println!("Middle age: {}", sorted_ages.1);
} Just like in Python, the _ indicates that we don't care about the middle value. The difference is that in Rust, there isn't a garbage collector (or reference counter) like in Python, so the unused value is only kept in scope till the function is exited. Also, we need to explicitly declare the type of each age element as unsigned 8-bit integers. The index operator for tuples in Rust is ., so we can access the middle age via sorted_ages.1. Running the function via main.rs gives us the same output as in Python: Youngest age: 18, oldest age: 65
Middle age: 41
